function t=sbe3cal(f);% SBE3 TEMPERATURE PROBE CALIBRATION EQUATION%function t=sbe3cal(f);%TEST clear, nargin=1; f=12000% SBE CAL -- JAN 2000g=4.82096020e-3; h=6.73945897e-4; i=2.68904920e-5; j=2.21085503e-6; f0=1000;if nargin == 0%ORIGINAL CALIBRATION VALUES% 	f=[% 		6058.554% 		6408.553%         6922.713% 		7465.776% 		8038.537% 		8641.753% 		9276.140% 		9942.361% 		10641.075% 		11372.914% 		12138.549];% 	fprintf('Calibration check on SBE3 calibration\n');		f=[6000:100:13100]';end% SBE CALIBRATION EQUATIONx=log(f0 ./ f);t =g + h .* x + i .* x.*x + j .* x.*x.*x;t = (1 ./ t) - 273.15;% PRNT OUT RESULTS AS A TABLEif nargin == 0	for i = 1:36		fprintf('%5d  %9.3f             %5d %9.3f\n',f(i),t(i),f(36+i),t(36+i));	endendreturn;